import React, { useRef, useEffect } from 'react';
import { Container } from './styles';
import axios from 'axios';

const Searchbar = () => {
	const stateRef = useRef();
	const cityRef = useRef();
	const url = 'https://restcountries.eu/rest/v2/all';
	useEffect(() => {
		axios.get(url).then((res) => {
			res.data.map(item => console.log(item.name));
		});
	}, [ ]);
	return (
		<Container>
			<div>
					<label> Select State </label>
					<input list="states" placeholder="Select State" />
					<datalist id="states" ref={stateRef} >
						<option>Rajsthan</option>
						<option>Madhya Pradesh</option>
					</datalist>
			</div>
			<div>
				<label> Select City </label>
				<input list="cities"  className="cities" />
				<datalist  id="cities" ref={cityRef} >
					<option>Kota</option>
					<option>Jaipur</option>
				</datalist>
			</div>
			<div>
				<img src='/assets/addMarkerIcon.jpg' alt="Add Marker" width={80} height={80}  />
			</div>
			<div>
				<img src="/assets/profile.jpg" width={80} height={80} />
			</div>
		</Container>
	);
};
export default Searchbar;
